 pool leisure area, separate gym studio and staff accommodation.</p><p>The property is offered on a furnished basis.<span></span><br></p>";s:13:"property_type";s:5:"House";s:6:"agents";a:1:{i:0;s:34:"/agents/beauchamp/karolina-fiszbak";}s:14:"ownership_type";s:9:"Apartment";s:17:"location_granular";s:11:"London, NW8";s:9:"openhouse";s:5:"false";s:5:"_file";s:122:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/2-international/rental/2015-11-24-65-avenue-road.md";s:11:"_local_path";s:65:"/1-properties/2-international/rental/2015-11-24-65-avenue-road.md";s:10:"_order_key";i:1448341200;s:13:"datetimestamp";N;s:9:"datestamp";i:1448341200;s:4:"date";s:19:"November 24th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1453417435;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:14:"65-avenue-road";s:7:"_folder";s:31:"properties/international/rental";s:9:"_basename";s:28:"2015-11-24-65-avenue-road.md";s:9:"_filename";s:25:"2015-11-24-65-avenue-road";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:9:"permalink";s:47:"/properties/international/rental/65-avenue-road";}}s:28:"2015-11-24-marathon-house.md";a:5:{s:6:"folder";s:31:"properties/international/rental";s:4:"path";s:65:"/1-properties/2-international/rental/2015-11-24-marathon-house.md";s:4:"file";s:28:"2015-11-24-marathon-house.md";s:3:"url";s:47:"/properties/international/rental/marathon-house";s:4:"data";a:45:{s:5:"title";s:14:"Marathon House";s:2:"id";s:36:"6f739152-d953-47e2-8325-feac907837cd";s:3:"url";s:47:"/properties/international/rental/marathon-house";s:15:"streeteasy_type";s:6:"rental";s:8:"currency";s:8:"sterling";s:5:"price";s:5:"43333";s:5:"terms";s:16:"6 month minimum ";s:17:"property_location";s:6:"London";s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"51.521572";s:9:"longitude";s:9:"-0.161181";}s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s: