gant and spacious two bedroom apartment is situated within Rutland Court; a magnificent red brick period mansion block on a private road. The 2,219 sq ft apartment offers wonderful proportions and high ceilings throughout. A generous entrance hall gives access to a stunning drawing room which interconnects to the grand dining area. A well appointed kitchen/breakfast room creates an informal place to dine. The master bedroom suite connects to a dressing room and a wonderful ensuite bathroom. The property has a further bedroom, a guest shower room, a guest cloakroom and two utility cupboards. Rutland Court is located on Rutland Gardens, a very desirable private road set behind security gates in the heart of Knightsbridge. The building is carefully managed with magnificent communal areas and 24-hour security and porterage. The property is only moments away from Hyde Park and the world class selection of shops, restaurants and amenities that the area provides, in particular Knightsbridge and Sloane Street.";s:13:"preview_image";s:58:"/assets/img/properties/sale/resized/LOR0022-BI-01-Hero.jpg";s:14:"photo_carousel";a:12:{i:0;s:45:"/assets/img/properties/sale/LOR0022-BI-01.jpg";i:1;s:45:"/assets/img/properties/sale/LOR0022-BI-02.jpg";i:2;s:45:"/assets/img/properties/sale/LOR0022-BI-04.jpg";i:3;s:45:"/assets/img/properties/sale/LOR0022-BI-05.jpg";i:4;s:45:"/assets/img/properties/sale/LOR0022-BI-06.jpg";i:5;s:45:"/assets/img/properties/sale/LOR0022-BI-07.jpg";i:6;s:45:"/assets/img/properties/sale/LOR0022-BI-08.jpg";i:7;s:45:"/assets/img/properties/sale/LOR0022-BI-09.jpg";i:8;s:45:"/assets/img/properties/sale/LOR0022-BI-10.jpg";i:9;s:45:"/assets/img/properties/sale/LOR0022-BI-11.jpg";i:10;s:45:"/assets/img/properties/sale/LOR0022-BI-12.jpg";i:11;s:45:"/assets/img/properties/sale/LOR0022-BI-13.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:0:"";s:6:"agents";a:1:{i:0;s:34:"/agents/beauchamp/karolina-fiszbak";}s:14:"ownership_type";s:9:"Apartment";s:17:"location_granular";s:1