1855) and is situated at the south west corner of Regent’s Park, on Cornwall Terrace. This magnificent Grade I listed home provides stunning views over the Park and has been both carefully restored to the specification of the Crown Estate and English Heritage and beautifully interior designed to provide the ultimate family accommodation. The property comprises some 8,833 sq ft as well as an adjacent Mews house of 1,140 sq ft.";s:12:"summary_full";s:2020:"<p>The property opens to a spectacular entrance hall leading through to the grand staircase which sweeps up through the building, with large windows and skylight which allows an abundance of natural light. There is also a custom made silent passenger lift to access all floors. The large family room and dining room retain their original classical proportions and have been beautifully restored, along with the library with original fireplace. The state-of-the-art kitchen is fully equipped with every modern feature including under floor heating and wine cooler.<br></p><p>The first floor comprises a principal reception room boasts classic piano Nobile dimensions, with floor areas of 530-870 sq ft and floor-to-ceiling windows providing plenty of natural light. The spacious study has pre-wire cabling, lending itself to be an office, as well as the media room which offers state of the art technology for home entertainment.<br></p><p>Situated across the whole of the second floor, the master suite comprises bedroom, ensuite bathroom, additional shower room and dressing room and enjoys traditional details, such as high skirting and intricate cornicing as well as bespoke Tyndale carpeting with Artisan silk borders add to the grandeur of this space. The master bathroom provides under heated flooring, oversized, inset bath as well as built-in high-definition plasma screen TV.<br></p><p>The third floor comprises four bedroom suites [two with shower rooms]. All bedrooms are generously proportioned, light and airy, and most can comfortably accommodate a super king size bed.<br></p><p>The lower ground floor comprises garage, vaults and staff accommodation offering a good sized double studio room, kitchenette and shower room. The gym and spa are located on the lower ground floor and have been designed to provide a serene and tranquil setting.<br></p><p>The Mews House comprises garage, living room, kitchen and guest cloakroom, with master bedroom, guest bedroom and roof terrace on the first floor.<br></p>";s:13:"preview_image";s:58:"/assets/img/properties/sale/resized/LOR0003-BI-01_Hero.jpg";s:14:"photo_carousel";a:9:{i:0;s:45:"/assets/img/properties/sale/LOR0003-BI-01.jpg";i:1;s:45:"/assets/img/properties/sale/LOR0003-BI-02.jpg";i:2;s:45:"/assets/img/properties/sale/LOR0003-BI-03.jpg";i:3;s:45:"/assets/img/properties/sale/LOR0003-BI-04.jpg";i:4;s:45:"/assets/img/properties/sale/LOR0003-BI-05.jpg";i:5;s:45:"/assets/img/properties/sale/LOR0003-BI-06.jpg";i:6;s:45:"/assets/img/properties/sale/LOR0003-BI-07.jpg";i:7;s:45:"/assets/img/properties/sale/LOR0003-BI-08.jpg";i:8;s:45:"/assets/img/properties/sale/LOR0003-BI-09.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:0:"";s:13:"property_type";s:5:"House";s:6:"agents";a:1:{i:0;s:34:"/agents/beauchamp/karolina-fiszbak";}s:14:"ownership_type";s:9:"Apartment";s:17:"location_granular";s:11:"London, NW1";s:9:"openhouse";s:5:"false";s:5:"_file";s:118:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/2-international/rental/2015-11-24-silk-house.md";s:11:"_local_path";s:61:"/1-properties/2-international/rental/2015-11-24-silk-house.md";s:10:"_order_key";i:1448341200;s:13:"datetimestamp";N;s:9:"datestamp";i:1448341200;s:4:"date";s:19:"November 24th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1453417438;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:10:"silk-house";s:7:"_folder";s:31:"properties/international/rental";s:9:"_basename";s:24:"2015-11-24-silk-house.md";s:9:"_filename";s:21:"2015-11-24-silk-house";s:9:"_i