l amenities and transport facilities. Accommodation - Entrance hall, drawing room, dining room, ground floor kitchen, lower ground floor kitchen, master bedroom suite including a dressing room, 5 further bedrooms, library/artists studio, 2 guest bathrooms and 2 cloakrooms. Amenities include a gym, summer house/artist's studio, plant room, vault, balcony, terrace and garden.";s:13:"preview_image";s:50:"/assets/img/properties/sale/LOB0021-BI-02-Hero.jpg";s:14:"photo_carousel";a:18:{i:0;s:60:"/assets/img/properties/sale/LOB0021-BI-01-20151123122126.jpg";i:1;s:60:"/assets/img/properties/sale/LOB0021-BI-03-20151123122132.jpg";i:2;s:60:"/assets/img/properties/sale/LOB0021-BI-04-20151123122132.jpg";i:3;s:60:"/assets/img/properties/sale/LOB0021-BI-05-20151123122133.jpg";i:4;s:60:"/assets/img/properties/sale/LOB0021-BI-06-20151123122133.jpg";i:5;s:60:"/assets/img/properties/sale/LOB0021-BI-07-20151123122133.jpg";i:6;s:60:"/assets/img/properties/sale/LOB0021-BI-08-20151123122133.jpg";i:7;s:60:"/assets/img/properties/sale/LOB0021-BI-09-20151123122133.jpg";i:8;s:60:"/assets/img/properties/sale/LOB0021-BI-10-20151123122133.jpg";i:9;s:60:"/assets/img/properties/sale/LOB0021-BI-11-20151123122134.jpg";i:10;s:60:"/assets/img/properties/sale/LOB0021-BI-12-20151123122134.jpg";i:11;s:60:"/assets/img/properties/sale/LOB0021-BI-13-20151123122135.jpg";i:12;s:60:"/assets/img/properties/sale/LOB0021-BI-14-20151123122135.jpg";i:13;s:60:"/assets/img/properties/sale/LOB0021-BI-15-20151123122135.jpg";i:14;s:60:"/assets/img/properties/sale/LOB0021-BI-16-20151123122135.jpg";i:15;s:60:"/assets/img/properties/sale/LOB0021-BI-17-20151123122136.jpg";i:16;s:60:"/assets/img/properties/sale/LOB0021-BI-18-20151123122136.jpg";i:17;s:60:"/assets/img/properties/sale/LOB0021-BI-20-20151123122136.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:0:"";s:6:"agents";a:1:{i:0;s:34:"/agents/beauchamp/karolina-fiszbak";}s:17:"location_granular";s:11:"London, W10";s:13:"property_type";s:14:"Detached House";s:9:"openh