s:4:"page";s:9:"_is_entry";i:0;s:8:"_is_page";i:1;s:3:"url";s:7:"/agents";s:9:"permalink";s:7:"/agents";}}s:16:"services/page.md";a:5:{s:6:"folder";s:1:"/";s:4:"path";s:19:"/3-services/page.md";s:4:"file";s:16:"services/page.md";s:3:"url";s:9:"/services";s:4:"data";a:41:{s:5:"title";s:8:"Services";s:9:"_fieldset";s:8:"services";s:9:"_template";s:8:"services";s:10:"hero_image";s:31:"/assets/img/Services_Hero-2.jpg";s:6:"header";s:12:"Our Services";s:10:"sub_header";s:86:"We span all aspects of the selling process for owners of all kinds. Which one are you?";s:20:"individual_subheader";s:28:"A Trusted Advisor from Day 1";s:22:"individual_description";s:521:"<p>Selling an asset as substantial as your home is a tremendous undertaking. You need the right support — a team that truly gets real estate in New York City, in your neighborhood and even on your block.</p><p>With Garfield, our entire company is your team, and it’s been that way since we started specializing in townhouse sales in 1972. From valuating your property to readying your space for sale, from developing the marketing strategy to maximizing sale prices, we lead the charge, every step of the way.<br></p>";s:16:"individual_quote";a:2:{i:0;a:4:{s:4:"main";s:247:"My family and I have used their service to buy, sell, and rent property. I have bought or sold numerous properties and no real estate agency I have dealt with comes close to their responsiveness to clients and their effectiveness in closing deals.";s:4:"logo";s:0:"";s:6:"person";s:15:"Andrew B. Gloss";s:11:"description";s:0:"";}i:1;a:4:{s:4:"main";s:202:"Leslie J Garfield brings years of expertise and professionalism to real estate sales and purchases as well critical insight into relevant market data. They are the ultimate in boutique brokerage in NYC.";s:4:"logo";s:0:"";s:6:"person";s:13:"Emanuel Stern";s:11:"description";s:18:"Tall Pines Capital";}}s:15:"trust_subheader";s:25:"A Vital Part of Your Team";s:17:"trust_description";s:671:"<p>Whether during inception or mid-way through the process, we become a vital part of how you administer your estate and trust. We assist family members, beneficiaries and fiduciaries to ensure they have proper property valuations, seamless integration with tax and legal representation and more than 40 years of experience maximizing selling prices when sales take place.</p><p>We represent individuals and their families, corporations and owners; executors and trustees, including individuals, banks and trust companies; and non-profit institutions including schools, museums, churches, health care organizations, professional societies and private foundations.<br></p>";s:11:"trust_quote";a:3:{i:0;a:4:{s:4:"main";s:227:"Garfield were sincere, honest, open, intelligent, rational, unbelievably patient and really nice. It was a pleasure doing business with you, and if I had to do it all again, I wouldn’t bother soliciting bids from anyone else.";s:4:"logo";s:0:"";s:6:"person";s:12:"Laura Avedon";s:11:"description";s:24:"Richard E. Avedon Estate";}i:1;a:4:{s:4:"main";s:0:"";s:4:"logo";s:40:"/assets/img/services/TRUST-Cleveland.png";s:6:"person";s:14:"Peter C. Volas";s:11:"description";s:61:"Senior Director of Real Estate, Cleveleland Clinic Foundation";}i:2;a:4:{s:4:"main";s:0:"";s:4:"logo";s:37:"/assets/img/services/TRUST-Mellon.png";s:6:"person";s:17:"Mr. Emanuel Stern";s:11:"description";s:28:"President, Mellon Foundation";}}s:19:"individual_services";a:9:{i:0;s:18:"Detailed valuation";i:1;s:30:"Marketing strategy development";i:2;s:24:"Marketing plan execution";i:3;s:29:"Property prepping and staging";i:4;s:28:"Day-to-day fielding of leads";i:5;s:19:"Open houses & tours";i:6;s:13:"Tenant issues";i:7;s:30:"Offer evaluation & negotiation";i:8;s:15:"Closing support";}s:14:"trust_services";a:9:{i:0;s:18:"Detailed valuation";i:1;s:30:"Marketing strategy development";i:2;s:24:"Marketing plan execution";i:3;s:29:"Property prepping and staging";i:4;s:28:"Day-to-day fielding of leads";i:5;s:19:"Open houses & tours";i:6;s:13:"Tenant issues";i:7;s:30:"Offer evaluation & negotiation";i:8;s:15:"Closing support";}s:21:"institution_subheader";s:25:"Real Insight, Real Advice";s:23:"institution_description";s:370:"<p>From administration and valuation, to acquisition and selling, we advise an array of institutions in all aspects of their real estate dealings. With more than 40 years of experience, we have come to understand that every institution is unique. The insight, advice and services we offer are tailored to your unique needs, and above all, designed to maximize value.</p>";s:20:"institution_services";a:6:{i:0;s:27:"Annual asset value analysis";i:1;s:32:"Management of real estate assets";i:2;s:37:"Communicate with institutional boards";i:3;s:55:"Sale or re-location of institutional real estate assets";i:4;s:32:"Purchase of institution property";i:5;s:49:"Advice and assitance on legal and accounting help";}s:17:"institution_quote";a:3:{i:0;a:4:{s:4:"main";s:193:"Whether looking for a luxurious townhouse or a one-of-a-kind building, New Yorkers turn to Leslie J. Garfield & Co for their years of experience and expertise in our city’s real estate market";s:4:"logo";s:0:"";s:6:"person";s:20:"Michael R. Bloomberg";s:11:"description";s:30:"Mayor, New York City 2002-2013";}i:1;a:4:{s:4:"main";s:0:"";s:4:"logo";s:38:"/assets/img/services/INSTI-Whitney.png";s:6:"person";s:13:"Adam Weinberg";s:11:"description";s:40:"Director, Whitney Museum of American Art";}i:2;a:4:{s:4:"main";s:0:"";s:4:"logo";s:40:"/assets/img/services/INSTI-Francaise.png";s:6:"person";s:23:"Hon. Motohide Yoshikawa";s:11:"description";s:46:"Ambassador Gov. of Japan to the United Nations";}}s:16:"buyers_subheader";s:41:"Helping make the right purchase decisions";s:18:"buyers_description";s:708:"<p>The knowledge, commitment and expertise that all buyers deserve, but few actually receive.</p><p>At Garfield, we find properties that meet your goals and help realize your dreams, whether you’re focused on buying in a specific neighborhood or open to learning about all of them.</p><p>Each of our brokers specializes in a particular neighborhood and brings a wealth of knowledge to your search. They have their fingers on the pulse down to specific blocks and individual properties.</p><p>By providing deep market insights and hyper-local perspective, we enable you to make better real estate-related decisions, from your initial search and making an offer to navigating contracts and final closing.</p>";s:15:"buyers_services";a:5:{i:0;s:12:"Goal-setting";i:1;s:15:"Property search";i:2;s:17:"Offer negotiation";i:3;s:19:"Transaction support";i:4;s:15:"Closing support";}s:12:"buyers_quote";a:2:{i:0;a:4:{s:4:"main";s:174:"Garfield had our trust instantly and through the various ups and downs of the process our faith in them never wavered. Not for a second. Strategic, tenacious and trustworthy.";s:4:"logo";s:0:"";s:6:"person";s:15:"Anonymous buyer";s:11:"description";s:0:"";}i:1;a:4:{s:4:"main";s:253:"Garfield were essential in facilitating our complex townhouse transaction.  Had they not been involved, the transaction would have fallen through.  We found them to be extremely knowledgeable, intelligent, thorough, incredibly prompt, and to the point. ";s:4:"logo";s:0:"";s:6:"person";s:24:"Keith & Rachel Cackowsky";s:11:"description";s:0:"";}}s:5:"_file";s:76:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/3-services/page.md";s:11:"_local_path";s:19:"/3-services/page.md";s:10:"_order_key";s:1:"3";s:13:"datetimestamp";N;s:9:"datestamp";N;s:4:"date";N;s:4:"time";N;s:7:"numeric";s:1:"3";s:13:"last_modified";i:1453416125;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:4:"page";s:7:"_folder";s:1:"/";s:9:"_basename";s:7:"page.md";s:9:"_filename";s:4:"page";s:9:"_is_entry";i:0;s:8:"_is_page";i:1;s:3:"url";s:9:"/services";s:9:"permalink";s:9:"/services";}}s:15:"company/page.md";a:5:{s:6:"folder";s:1:"/";s:4:"path";s:18:"/4-company/page.md";s:4:"file";s:15:"company/page.md";s:3:"url";s:8:"/company";s:4:"data";a:30:{s:5:"title";s:7:"Company";s:9:"_fieldset";s:7:"company";s:9:"_template";s:7:"company";s:7:"beliefs";s:274:"The truth matters. When we provide you with honest advice, experienced perspective, and the facts to back it up, we become a trusted partner who helps you make better decisions about the future of your property. We are in the business of revealing truths to earn your trust.";s:7:"history";s:745:"<p>At Garfield, we have been committed to providing the best
service and perspective to clients for more than 40 years.</p><p>The day Leslie J. Garfield opened the firm’s doors, he had a
singular focus in mind: to be the best. For him, that meant being
the most knowledgeable, the hardest working and an honest
negotiator for clients.</p><p>Along the way, the firm grew into New York City’s premier
experts in townhomes and small buildings. Our growing team of
sales and marketing talent is recognized by institutional clients,
individuals and the industry overall for providing outstanding
service and insight, plus record-breaking sales.</p><p>Today, Leslie’s son, Jed Garfield, leads the firm while Leslie
remains Chairman Emeritus.</p>";s:3:"why";s:220:"<p>We are in the business of enabling you to make better decisions about the future of your property, which has helped us become New York City’s foremost broker for selling and buying townhomes and small buildings.</p>";s:8:"why_grid";a:4:{i:0;a:2:{s:4:"name";s:9:"expertise";s:11:"description";s:163:"We have specialized in selling properties like yours for more than 40 years. We have repeatedly ranked as a “Top Residential Firm” in The Real Deal since 2009.";}i:1;a:2:{s:4:"name";s:10:"commitment";s:11:"description";s:172:"We are unusually committed to our clients and go to great lengths to make great things happen. Our focus is on all aspects of selling your property, from pre- to post-sale.";}i:2;a:2:{s:4:"name";s:9:"knowledge";s:11:"description";s:162:"We know every aspect of townhomes and buildings in New York City – from overall markets to individual properties, zoning, taxes, SROs, landmark status and more.";}i:3;a:2:{s:4:"name";s:13:"collaboration";s:11:"description";s:119:"We are an agile, tight-knit group that collaborates, with each other, and our clients. The entire company is your team.";}}s:19:"international_image";s:0:"";s:13:"international";s:1041:"<p>Leslie J Garfield is proud to have Beauchamp Estates, London
as our International partner and affiliate.</p><p>Beauchamp Estates has 35 years of experience in prime central
London and European property. Founded in 1979, Beauchamp
Estates has grown to become a multinational firm, with offices
in London, Cannes, Mykonos and Florence and Israel. <br></p><p>Beauchamp Estates work with private individuals and family
trusts, providing an exceptional level of personal care, guidance
and considered advice on a one-to-one basis; at the same time,
they offer services to those individuals and organisations for
whom property has wider commercial implications, including
professional landlords and investors, developers and
corporations.</p><p>Privately owned and personally managed, Beauchamp Estates is
led by Gary Hersham and Penelope Court who are fully involved
