<![endif]--><!--StartFragment--><p class="MsoNormal"><br></p><p class="MsoNormal">Caylyn,
a Real Estate Adviser at Leslie J. Garfield & Company, specializes in the
sale and lease of townhouses on the Upper East Side of Manhattan. </p><p class="MsoNormal">
Originally from
outside of Boston, Caylyn graduated from the Dexter-Southfield School in
Brookline, MA before earning her B.S. in Exercise Science from Skidmore
College. At Skidmore, she was a member of the nationally ranked field hockey
team and was a recipient of the team’s Thoroughbred award, given for her
dedication, perseverance and commitment to the team. </p><p class="MsoNormal">
Caylyn is a member
of the Urban Land Institute, a global non-profit research and education
organization representing the entire spectrum of land use and real estate
development disciplines. She is actively involved with the organization's Young
Leaders Group as well as the Women's Leadership Initiative. She currently
resides on the Upper East Side and enjoys staying active and exploring the city
in her free time.<o:p></o:p></p><!--EndFragment-->";s:9:"datestamp";i:1440043200;s:6:"author";s:1:"1";s:5:"_file";s:105:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-20-caylyn-sullivan.md";s:11:"_local_path";s:48:"/2-agents/garfield/2015-08-20-caylyn-sullivan.md";s:10:"_order_key";i:1440043200;s:13:"datetimestamp";N;s:4:"date";s:17:"August 20th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944700;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:15:"caylyn-sullivan";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:29:"2015-08-20-caylyn-sullivan.md";s:9:"_filename";s:26:"2015-08-20-caylyn-sullivan";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:32:"/agents/garfield/caylyn-sullivan";s:9:"permalink";s:32:"/agents/garfield/caylyn-sullivan";}}s:31:"2015-08-21-lydia-rosengarten.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:50:"/2-agents/garfield/2015-08-21-lydia-rosengarten.md";s:4:"file";s:31:"2015-08-21-lydia-rosengarten.md";s:3:"url";s:34:"/agents/garfield/lydia-rosengarten";s:4:"data";a:26:{s:5:"title";s:17:"Lydia Rosengarten";s:5:"image";s:40:"/assets/img/agents/L.Rosengarten-011.jpg";s:5:"phone";s:12:"212-574-6964";s:5:"email";s:24:"lydia@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:1243:"<p><span id="docs-internal-guid-fd04118e-d8ee-9dc8-6e4e-bdb2274cd419"></span></p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Ms. Rosengarten joined Leslie J. Garfield in 1996 as Director of Sales focusing on the Upper East Side and more specifically, the East 80's where she has concentrated most of her sales. Recently, Ms. Rosengarten has sold a significant number of townhouses East of Second Avenues, having sold 504 East 87th Street, 514 East 87th Street, 546 East 82nd Street and recently, 524 East 82nd Street and 433 East 85th Street.  She is actively listing several other townhouses in the immediate vicinity including 441 East 87th Street.</p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Prior to joining Garfield in 1996, Ms. Rosengarten practiced for several years as a clinical psychiatric social worker after getting her graduate degree from Hunter College Social Work School. She received her undergraduate degree from University of Wisconsin, Madison and grew up in Manhattan. Currently Ms. Rosengarten is living in Cold Spring, New York with her 12 year old daughter, Emi.  Her older daughter is graduating from SUNY New Paltz and she plans on attending medical school. </p>";s:6:"author";s:1:"1";s:9:"datestamp";i:1440129600;s:5:"_file";s:107:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-21-lydia-rosengarten.md";s:11:"_local_path";s:50:"/2-agents/garfield/2015-08-21-lydia-rosengarten.md";s:10:"_order_key";i:1440129600;s:13:"datetimestamp";N;s:4:"date";s:17:"August 21st, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944700;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:17:"lydia-rosengarten";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:31:"2015-08-21-lydia-rosengarten.md";s:9:"_filename";s:28:"2015-08-21-lydia-rosengarten";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:34:"/agents/garfield/lydia-rosengarten";s:9:"permalink";s:34:"/agents/garfield/lydia-rosengarten";}}s:34:"2015-08-22-christopher-l-riccio.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:53:"/2-agents/garfield/2015-08-22-christopher-l-riccio.md";s:4:"file";s:34:"2015-08-22-christopher-l-riccio.md";s:3:"url";s:37:"/agents/garfield/christopher-l-riccio";s:4:"data";a:26:{s:5:"title";s:20:"Christopher L Riccio";s:5:"image";s:43:"/assets/img/agents/ChristopherRiccio-03.jpg";s:5:"phone";s:12:"212-574-6962";s:5:"email";s:27:"clriccio@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:1304:"<p><span id="docs-internal-guid-fd04118e-d8ed-cf8b-19df-04552a21a4df"></span></p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Christopher L. Riccio joined Leslie J. Garfield in 2011 and specializes in the sales and leasing of buildings in the West Village. Christopher has work experience at The Bank of NY Mellon within Global Client Management and UBS in Wealth Management. Christopher was raised in upstate New York where he attended the Albany Academies and Bethlehem schools.Christopher was a two sport athlete in Lacrosse and Hockey playing in the New England Prep School League. He received a Division 1 Athletic Scholarship to Wagner College in Lacrosse where he studied Finance. </p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Christopher brings the same competitiveness, passion and work ethic to real estate. He is a dedicated, self starter whose aim is to deliver the highest individualized service to his clients in researching the market and understanding the characteristics and advantages of each property listing and neighborhood. Christopher currently resides in the heart of the West Village and maintains his fitness through running in Central Park, playing hockey at Chelsea Piers and as a member of the New York Athletic Club. </p>";s:9:"datestamp";i:1440216000;s:6:"author";s:1:"1";s:5:"_file";s:110:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-22-christopher-l-riccio.md";s:11:"_local_path";s:53:"/2-agents/garfield/2015-08-22-christopher-l-riccio.md";s:10:"_order_key";i:1440216000;s:13:"datetimestamp";N;s:4:"date";s:17:"August 22nd, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944700;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:20:"christopher-l-riccio";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:34:"2015-08-22-christopher-l-riccio.md";s:9:"_filename";s:31:"2015-08-22-christopher-l-riccio";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:37:"/agents/garfield/christopher-l-riccio";s:9:"permalink";s:37:"/agents/garfield/christopher-l-riccio";}}s:27:"2015-08-23-diane-procter.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:46:"/2-agents/garfield/2015-08-23-diane-procter.md";s:4:"file";s:27:"2015-08-23-diane-procter.md";s:3:"url";s:30:"/agents/garfield/diane-procter";s:4:"data";a:26:{s:5:"title";s:13:"Diane Procter";s:5:"image";s:35:"/assets/img/agents/DianeProcter.jpg";s:5:"phone";s:12:"917-882-6416";s:5:"email";s:27:"dprocter@lesliegarfield.com";s:4:"info";s:1086:"<p><span id="docs-internal-guid-fd04118e-d8ec-7cf9-fbb9-e5ceb657c500"></span></p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Diane Procter joined Leslie J. Garfield’s team as a sales agent in 2010. A native Texan, upon graduating from the University of Texas at Austin where she earned a Bachelors of Architecture, she moved to New York City. Upon arrival, she worked in the field of architecture until obtaining her Architectural License. In 1989 she established an architectural partnership. The practice focused on the renovation and preservation of high-end residential projects, most notably historic townhouses. These skills and experiences she brings to the field of Real Estate as she continues to practice architecture on a limited project basis.</p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Diane is a Board Member of the French American Aid for Children, a seventy-year old charity focusing on children’s health and education. She is also involved with the Central Park Conservancy where she works as a volunteer.</p>";s:5:"press";s:0:"";s:9:"datestamp";i:1440302400;s:6:"author";s:1:"1";s:5:"_file";s:103:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-23-diane-procter.md";s:11:"_local_path";s:46:"/2-agents/garfield/2015-08-23-diane-procter.md";s:10:"_order_key";i:1440302400;s:13:"datetimestamp";N;s:4:"date";s:17:"August 23rd, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944700;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:13:"diane-procter";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:27:"2015-08-23-diane-procter.md";s:9:"_filename";s:24:"2015-08-23-diane-procter";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:30:"/agents/garfield/diane-procter";s:9:"permalink";s:30:"/agents/garfield/diane-procter";}}s:25:"2015-08-24-ravi-kantha.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:44:"/2-agents/garfield/2015-08-24-ravi-kantha.md";s:4:"file";s:25:"2015-08-24-ravi-kantha.md";s:3:"url";s:28:"/agents/garfield/ravi-kantha";s:4:"data";a:26:{s:5:"title";s:11:"Ravi Kantha";s:5:"image";s:32:"/assets/img/agents/Headshot2.jpg";s:5:"phone";s:12:"212-574-6979";s:5:"email";s:26:"rkantha@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:1485:"<p>Ravi Kantha is a Real Estate Adviser who specializes in townhouse and building sales in Brooklyn Heights and Downtown Manhattan. Since joining Leslie J. Garfield & Co. in 2015, Ravi has sold or placed into contract over $70 million of townhouse real estate and is currently representing over $50 million in exclusive listings. Ravi joined the firm after spending several years as an attorney, first as a prosecutor and later in private practice focused on white collar defense, criminal defense, and securities litigation. Through his professional experience, Ravi has developed a reputation for his dedication to excellent client service, attention to detail, and professionalism. Together with his passion for New York City real estate, those skills enable him to ensure that his clients receive the very best real estate experience.<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; font-size: 12px; line-height: 17px;"><br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; font-size: 12px; line-height: 17px;"></p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Ravi is a graduate of Fordham University School of Law, Susquehanna University, and Fordham Preparatory School. At Susquehanna, Ravi received his B.A. in political science and was a four-year letter winner on the varsity football team, as well as a member of the varsity lacrosse team.</p>";s:9:"datestamp";i:1440388800;s:6:"author";s:1:"1";s:5:"_file";s:101:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-24-ravi-kantha.md";s:11:"_local_path";s:44:"/2-agents/garfield/2015-08-24-ravi-kantha.md";s:10:"_order_key";i:1440388800;s:13:"datetimestamp";N;s:4:"date";s:17:"August 24th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944700;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:11:"ravi-kantha";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:25:"2015-08-24-ravi-kantha.md";s:9:"_filename";s:22:"2015-08-24-ravi-kantha";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:28:"/agents/garfield/ravi-kantha";s:9:"permalink";s:28:"/agents/garfield/ravi-kantha";}}s:28:"2015-08-25-francis-o-shea.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:47:"/2-agents/garfield/2015-08-25-francis-o-shea.md";s:4:"file";s:28:"2015-08-25-francis-o-shea.md";s:3:"url";s:31:"/agents/garfield/francis-o-shea";s:4:"data";a:26:{s:5:"title";s:14:"Francis O'Shea";s:5:"phone";s:12:"212-574-6975";s:5:"email";s:25:"foshea@lesliegarfield.com";s:5:"image";s:43:"/assets/img/agents/FrancisOShea-01 copy.JPG";s:5:"press";a:2:{i:0;a:4:{s:5:"image";s:46:"/assets/img/agents/Observer-20151009154022.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:94:"http://observer.com/2014/03/get-on-your-horse-shipping-magnate-snaps-up-12-49-m-ues-townhouse/";}i:1;a:4:{s:5:"image";s:46:"/assets/img/agents/RealDeal-20151009154051.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:84:"http://therealdeal.com/blog/2014/12/19/france-sells-carnegie-hill-townhouse-for-36m/";}}s:4:"info";s:21730:"<!--[if gte mso 9]><xml>
