<p class="LJGbiocopygeneral">Born
and raised on the Upper West Side, Francis attended St. David’s School,
Deerfield Academy, and graduated with a B.A. in Government from Skidmore
College in 2005. He came to Leslie J. Garfield & Co., Inc. in 2007, and
since that time has been responsible for the sale of over $200,000,000 of
townhouse real estate, including the sale of 1143 Fifth Avenue on behalf of the
French Republic for $36,400,000 and 20 East 64th Street, a 25’-wide limestone
mansion for $23,000,000.</p><p class="LJGbiocopygeneral"><span></span>He is an avid golfer, and is an active member of
the St. David’s Alumni Council as well as the American Irish Historical
Society. Francis lives in Irvington, NY with his wife Erika and their daughter
Margaret Helen.<span></span></p>";s:9:"datestamp";i:1440475200;s:6:"author";s:1:"1";s:5:"_file";s:104:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-25-francis-o-shea.md";s:11:"_local_path";s:47:"/2-agents/garfield/2015-08-25-francis-o-shea.md";s:10:"_order_key";i:1440475200;s:13:"datetimestamp";N;s:4:"date";s:17:"August 25th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944699;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:14:"francis-o-shea";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:28:"2015-08-25-francis-o-shea.md";s:9:"_filename";s:25:"2015-08-25-francis-o-shea";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:31:"/agents/garfield/francis-o-shea";s:9:"permalink";s:31:"/agents/garfield/francis-o-shea";}}s:28:"2015-08-26-matthew-pravda.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:47:"/2-agents/garfield/2015-08-26-matthew-pravda.md";s:4:"file";s:28:"2015-08-26-matthew-pravda.md";s:3:"url";s:31:"/agents/garfield/matthew-pravda";s:4:"data";a:26:{s:5:"title";s:14:"Matthew Pravda";s:5:"image";s:40:"/assets/img/agents/MatthewPravda-001.jpg";s:5:"phone";s:12:"212-574-6969";s:5:"email";s:26:"mpravda@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:1235:"<p>Matthew Pravda, joined Leslie J. Garfield & Co. Inc. in 2000. Over the course of the last fifteen years he has had sales totaling over $500,000,000 and been retained often for his well-known reputation. His knowledge of property value, in depth understanding of the market, and ability to create client trust, has made him one of the top agents in Manhattan today.</p><p>Matthew is responsible for the sale and leasing of over 150 residential, commercial and institutional townhouse properties. An earned ranking of #22 among NYC’s top brokers as per The Real Deal magazine and repeated appearances in publications such as the Wall Street Journal, NY Times, Daily News, NY Observer and NY Magazine, confirm Matthew as an industry leader.</p><p>Earning his BA in Economics from Kean University in 1999, Matthew’s rise is based on a unique host of talents. Accomplished in a range of areas, he is a former tennis professional and a member of Twin Brooks Country Club. Matthew sits on the board of directors of New Destiny Housing, a New York City nonprofit that provides long term housing to victims and children of domestic violence. He currently resides in Hoboken, New Jersey with his wife Leigh, daughter Lily and son Max.</p>";s:9:"datestamp";i:1440561600;s:6:"author";s:1:"1";s:5:"_file";s:104:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-26-matthew-pravda.md";s:11:"_local_path";s:47:"/2-agents/garfield/2015-08-26-matthew-pravda.md";s:10:"_order_key";i:1440561600;s:13:"datetimestamp";N;s:4:"date";s:17:"August 26th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944698;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:14:"matthew-pravda";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:28:"2015-08-26-matthew-pravda.md";s:9:"_filename";s:25:"2015-08-26-matthew-pravda";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:31:"/agents/garfield/matthew-pravda";s:9:"permalink";s:31:"/agents/garfield/matthew-pravda";}}s:23:"2015-08-27-dane-hope.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:42:"/2-agents/garfield/2015-08-27-dane-hope.md";s:4:"file";s:23:"2015-08-27-dane-hope.md";s:3:"url";s:26:"/agents/garfield/dane-hope";s:4:"data";a:26:{s:5:"title";s:9:"Dane Hope";s:5:"image";s:35:"/assets/img/agents/DaneHOPE-022.jpg";s:5:"phone";s:12:"212-574-6971";s:5:"email";s:22:"dgh@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:830:"<p><span id="docs-internal-guid-fd04118e-d8e8-da68-2ffc-6f530b94ddde"></span></p><p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Mr. Hope is a Manhattan native and graduate of the Saint David’s School, The Browning School and Fordham University. In addition, he is a member of The Real Estate Board of New York, and full-time resident of Manhattan. Mr. Hope takes pride in his profession, providing clients with the highest level of discretion, coupled with an unprecedented amount of loyalty and trust. Recognizing that buying and selling a home is a cathartic experience. With this keen insight he never overlooks the importance of how the personal, emotional and financial effects that transition plays in the lives of his clients. Mr. Hope specializes in the neighborhoods of Midtown East and West.</p>";s:9:"datestamp";i:1440648000;s:6:"author";s:1:"1";s:5:"_file";s:99:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-27-dane-hope.md";s:11:"_local_path";s:42:"/2-agents/garfield/2015-08-27-dane-hope.md";s:10:"_order_key";i:1440648000;s:13:"datetimestamp";N;s:4:"date";s:17:"August 27th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944698;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:9:"dane-hope";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:23:"2015-08-27-dane-hope.md";s:9:"_filename";s:20:"2015-08-27-dane-hope";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:26:"/agents/garfield/dane-hope";s:9:"permalink";s:26:"/agents/garfield/dane-hope";}}s:28:"2015-08-28-lindsay-cresta.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:47:"/2-agents/garfield/2015-08-28-lindsay-cresta.md";s:4:"file";s:28:"2015-08-28-lindsay-cresta.md";s:3:"url";s:31:"/agents/garfield/lindsay-cresta";s:4:"data";a:25:{s:5:"title";s:14:"Lindsay Cresta";s:5:"image";s:40:"/assets/img/agents/LindsayCresta-044.jpg";s:5:"phone";s:12:"212-574-6961";s:5:"email";s:26:"lcresta@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:468:"<p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Lindsay Cresta a native of Arizona joined Leslie J Garfield & Co in January 2010 as the Office Manager. Lindsay comes from an operations background and owned and operated her own bakery for several years. She holds a Bachelors degree in Biological Sciences from St. Johns University.<br>Lindsay resides in Astoria with her husband Anthony an HR specialist and their two children Kyle and Lyla.
</p>";s:9:"datestamp";i:1440734400;s:5:"_file";s:104:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-28-lindsay-cresta.md";s:11:"_local_path";s:47:"/2-agents/garfield/2015-08-28-lindsay-cresta.md";s:10:"_order_key";i:1440734400;s:13:"datetimestamp";N;s:4:"date";s:17:"August 28th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944699;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:14:"lindsay-cresta";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:28:"2015-08-28-lindsay-cresta.md";s:9:"_filename";s:25:"2015-08-28-lindsay-cresta";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:31:"/agents/garfield/lindsay-cresta";s:9:"permalink";s:31:"/agents/garfield/lindsay-cresta";}}s:28:"2015-08-29-matthew-lesser.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:47:"/2-agents/garfield/2015-08-29-matthew-lesser.md";s:4:"file";s:28:"2015-08-29-matthew-lesser.md";s:3:"url";s:31:"/agents/garfield/matthew-lesser";s:4:"data";a:26:{s:5:"title";s:14:"Matthew Lesser";s:5:"image";s:51:"/assets/img/agents/MattLesser-05-20151109093747.jpg";s:5:"phone";s:12:"212-574-6959";s:5:"email";s:26:"mlesser@lesliegarfield.com";s:5:"press";a:8:{i:0;a:4:{s:5:"image";s:30:"/assets/img/agents/Forbes2.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:120:"http://www.forbes.com/sites/morganbrennan/2011/06/30/how-ukrainian-billionaire-alexander-rovt-bought-the-sloane-mansion/";}i:1;a:4:{s:5:"image";s:47:"/assets/img/agents/RealDeal2-20151120165533.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:99:"http://therealdeal.com/blog/2015/01/12/leslie-j-garfield-lists-his-west-village-townhouse-for-9-3m/";}i:2;a:4:{s:5:"image";s:47:"/assets/img/agents/RealDeal2-20151120165543.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:58:"http://therealdeal.com/issues_articles/pre-auction-frenzy/";}i:3;a:4:{s:5:"image";s:42:"/assets/img/agents/NYT2-20151120165603.png";s:4:"file";s:41:"/assets/img/agents/lesser_sqft_0509_2.pdf";s:4:"text";s:0:"";s:4:"link";s:0:"";}i:4;a:4:{s:5:"image";s:27:"/assets/img/agents/REW2.png";s:4:"file";s:42:"/assets/img/agents/REWeekly228e58LEASE.pdf";s:4:"text";s:0:"";s:4:"link";s:0:"";}i:5;a:4:{s:5:"image";s:42:"/assets/img/agents/REW2-20151120172145.png";s:4:"file";s:43:"/assets/img/agents/137e18Brokers Weekly.jpg";s:4:"text";s:0:"";s:4:"link";s:0:"";}i:6;a:4:{s:5:"image";s:42:"/assets/img/agents/WSJ2-20151123091113.png";s:4:"file";s:32:"/assets/img/agents/18e68_WSJ.pdf";s:4:"text";s:0:"";s:4:"link";s:0:"";}i:7;a:4:{s:5:"image";s:30:"/assets/img/agents/Crains2.png";s:4:"file";s:44:"/assets/img/agents/Crain's-LESSER-109w17.pdf";s:4:"text";s:0:"";s:4:"link";s:0:"";}}s:4:"info";s:1698:"<p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">Born and raised in Manhattan, Matthew Lesser joined Leslie J. Garfield & Co., Inc. in 2005 as a Vice President overseeing the Gramercy Park, Chelsea, and Central Village business. In 2014 Matt was named Partner of the firm.</p><p dir="ltr">Matthew has represented over $850 million in residential, commercial and institutional real estate, and been responsible for the sale and leasing of over 150 properties. He has been consistently ranked a “Top 100 Residential Agent” by The Real Deal Magazine and frequently noted in publications such as the Wall Street Journal, NY Times, Daily News, NY Observer and Real Estate Weekly.</p><p dir="ltr">Of note, Matthew still holds the record for the most expensive townhouse transaction on the Upper West Side with the sale of 247 Central Park West for $22,375,000, brokered the sale of the Henry T. Sloane Mansion at 18 East 68th Street which sold for over $30,000,000, acted as advisor to the purchaser on 45 John Street which sold for $47,000,000 and acted as a consultant to the purchaser of 14 Wall Street which sold for $303 million in 2012.</p><p dir="ltr">Matthew was a graduate of Trevor Day School in Manhattan and later earned a BS degree from Skidmore College with a Business Management major and an Economics minor. While at Skidmore, Matt played four years of Division III basketball. He remains active in the community as a member of both Friends of Skidmore Athletics and Friends of The President. Matthew is also a member of The Seawane Club.</p><p dir="ltr">He currently resides in Scarsdale, New York with his wife Erin and their two children Riley and Jillian.</p>";s:9:"datestamp";i:1440820800;s:6:"author";s:1:"1";s:5:"_file";s:104:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-29-matthew-lesser.md";s:11:"_local_path";s:47:"/2-agents/garfield/2015-08-29-matthew-lesser.md";s:10:"_order_key";i:1440820800;s:13:"datetimestamp";N;s:4:"date";s:17:"August 29th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944699;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:14:"matthew-lesser";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:28:"2015-08-29-matthew-lesser.md";s:9:"_filename";s:25:"2015-08-29-matthew-lesser";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:31:"/agents/garfield/matthew-lesser";s:9:"permalink";s:31:"/agents/garfield/matthew-lesser";}}s:33:"2015-08-29-richard-pretsfelder.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:52:"/2-agents/garfield/2015-08-29-richard-pretsfelder.md";s:4:"file";s:33:"2015-08-29-richard-pretsfelder.md";s:3:"url";s:36:"/agents/garfield/richard-pretsfelder";s:4:"data";a:26:{s:5:"title";s:19:"Richard Pretsfelder";s:5:"phone";s:12:"212-574-6965";s:5:"email";s:22:"rdp@lesliegarfield.com";s:5:"image";s:42:"/assets/img/agents/RickPRETSFELDER-013.jpg";s:5:"press";a:2:{i:0;a:4:{s:5:"image";s:41:"/assets/img/agents/NYT-20151009143832.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:193:"http://www.nytimes.com/2014/11/09/realestate/upper-west-side-townhouse-market.html?hpw&rref=realestate&action=click&pgtype=Homepage&module=well-region&region=bottom-well&WT.nav=bottom-well&_r=0";}i:1;a:4:{s:5:"image";s:32:"/assets/img/agents/Observer2.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:108:"http://observer.com/2015/10/past-imperfect-grand-old-townhouses-battle-their-convenient-modern-counterparts/";}}s:9:"datestamp";i:1440820800;s:4:"info";s:1159:"<p>A Manhattan native, Mr. Pretsfelder joined Leslie J. Garfield in 2002 as a Managing Director overseeing the firm’s Upper West Side business. In 2005, he was named Partner and his responsibilities expanded to include management of the firm's marketing and operations. He is responsible for the sale of over 100 residential, commercial and institutional townhouse properties, including the sale of the most expensive townhouse on the Upper West Side of Manhattan in 2008 and 2011. Prior to joining Leslie J. Garfield, Mr. Pretsfelder was a Group Vice President at Winstar Communications, where he founded and ran Office.com, a small business portal owned in conjunction with CBS, Inc. His position at Winstar followed stints as an executive at CBS, Inc., and as Budget Director of the Massachusetts Senate Committee On Ways and Means, where he oversaw creation of the state's $15 billion annual operating budget. Mr. Pretsfelder holds a Masters in Business Administration from Columbia Business School, a BA from Tufts University, and is a graduate of Horace Mann School. He lives in Manhattan with his wife Liliana, an attorney, and his two children. </p>";s:6:"author";s:1:"1";s:5:"_file";s:109:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-29-richard-pretsfelder.md";s:11:"_local_path";s:52:"/2-agents/garfield/2015-08-29-richard-pretsfelder.md";s:10:"_order_key";i:1440820800;s:13:"datetimestamp";N;s:4:"date";s:17:"August 29th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944699;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:19:"richard-pretsfelder";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:33:"2015-08-29-richard-pretsfelder.md";s:9:"_filename";s:30:"2015-08-29-richard-pretsfelder";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:36:"/agents/garfield/richard-pretsfelder";s:9:"permalink";s:36:"/agents/garfield/richard-pretsfelder";}}s:26:"2015-08-31-jed-garfield.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:45:"/2-agents/garfield/2015-08-31-jed-garfield.md";s:4:"file";s:26:"2015-08-31-jed-garfield.md";s:3:"url";s:29:"/agents/garfield/jed-garfield";s:4:"data";a:28:{s:5:"title";s:12:"Jed Garfield";s:5:"phone";s:12:"212-574-6980";s:5:"email";s:22:"jhg@lesliegarfield.com";s:5:"image";s:53:"/assets/img/agents/JedGARFIELD-013-20150818135851.jpg";s:4:"info";s:1429:"<p>Jed Garfield, a Manhattan native and graduate of the Dalton School, entered the field of real estate in 1985 after receiving his BA from Skidmore College. He completed the training program and, after three-year stint in the commercial leasing group of Grubb & Ellis, received an MA in Political Economics from the School of International and Public Affairs at Columbia University. He has been with Leslie J. Garfield & Co., Inc. since 1990 and was promoted to Managing Partner in 1998. He acquired the firm in 2003. He is responsible for the sale of over 600 residential, commercial and institutional townhouse properties, including the sales of the most expensive townhouse in Manhattan in the years 1999, 2005 and 2006 as well as the most expensive sale of a townhouse on the Upper West Side of Manhattan in 2008.</p><p>He is a member of the Sales Brokers Committee of the Real Estate Board of New York, and a visiting lecturer at the Brownstone Revival Committee. He is also a Trustee of the New York Youth Symphony and member of its Executive Committee. In addition he is on the Board of the Tang Museum of Art at Skidmore College and a Patron of the Dalton School and sits on the Advisory Board of Quest Media. Jed is also a member of the Madison Avenue BID board.<br></p><p>Mr. Garfield resides on the Upper East Side of Manhattan, in a townhouse, with his wife Karen, a physician, and two sons Clay and Charlie.<br></p>";i:0;s:454:"<p>He is a member of the Sales Brokers Committee of the Real Estate Board of New York, and a visiting lecturer at the Brownstone Revival Committee. He is also a Trustee of the New York Youth Symphony and member of its Executive Committee. In addition he is on the Board of the Tang Museum of Art at Skidmore College and a Patron of the Dalton School and sits on the Advisory Board of Quest Media. Jed is also a member of the Madison Avenue BID board.</p>";i:1;s:146:"</p>Mr. Garfield resides on the Upper East Side of Manhattan, in a townhouse, with his wife Karen, a physician, and two sons Clay and Charlie.</p>";s:5:"press";a:3:{i:0;a:4:{s:5:"image";s:32:"/assets/img/agents/RealDeal2.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:52:"http://therealdeal.com/google-search/?q=Jed+Garfield";}i:1;a:4:{s:5:"image";s:27:"/assets/img/agents/NYT2.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:84:"http://www.nytimes.com/2014/04/27/realestate/a-mission-of-a-different-kind.html?_r=0";}i:2;a:4:{s:5:"image";s:30:"/assets/img/agents/NY-mag2.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:51:"http://nymag.com/realestate/realestatecolumn/70256/";}}s:6:"author";s:1:"1";s:9:"datestamp";i:1440993600;s:5:"_file";s:102:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-31-jed-garfield.md";s:11:"_local_path";s:45:"/2-agents/garfield/2015-08-31-jed-garfield.md";s:10:"_order_key";i:1440993600;s:13:"datetimestamp";N;s:4:"date";s:17:"August 31st, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1456944699;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:12:"jed-garfield";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:26:"2015-08-31-jed-garfield.md";s:9:"_filename";s:23:"2015-08-31-jed-garfield";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:29:"/agents/garfield/jed-garfield";s:9:"permalink";s:29:"/agents/garfield/jed-garfield";}}s:29:"2015-09-16-leslie-garfield.md";a:5:{s:6:"folder";s:15:"agents/ga